events.description:
ICP.Hub Philippines recently conducted an enriching learning session at Ateneo de Manila University, focusing on #InternetComputer – ICP: Understanding the Basics and Beyond (Workshop). In collaboration with an esteemed partner, the Cryptocurrency Club of the University 🤝, the Hub eagerly engaged with the bright minds of the institution.
The Hub is thrilled to forge connections with the future builders of the University! 👨‍💻👩‍💻
The event unveiled exciting opportunities as it delved into the realms of decentralized computing, canisters and cycles, real-world DApps, and more. It was a dynamic showcase of the limitless possibilities that the Internet Computer platform brings to the table.&quot;
